import Navbar from "../../components/navbar"
import profil from '../../assets/profil.png'

const Experience = () => {
    return (
        <div>
            <Navbar />
                <img src={profil} className="mx-auto w-[]" alt="Photo Profile"/>
        </div>
    )
}
export default Experience
